function statHalfDonut(t,e,n){nv.addGraph(function(){var a=400,r=400,l=nv.models.pieChart().x(function(t){return t.label}).y(function(t){return t.value}).showLabels(!0).color(function(t){return t.data.color}).width(a).height(r).donut(!0);return l.pie.startAngle(function(t){return t.startAngle/2-Math.PI/2}).endAngle(function(t){return t.endAngle/2-Math.PI/2}),d3.select("#"+t).datum(JSON.parse(e)).transition().duration(1200).attr("width",a).attr("height",r).call(l),d3.select("#"+t).append("text").attr("x",a/2).attr("y",0-margin.top/2).attr("text-anchor","middle").style("font-weight","bold").text(n),l})}function statBar(t,e,n,a){nv.addGraph(function(){var r=380,l=nv.models.discreteBarChart().x(function(t){return t.label}).y(function(t){return t.value}).width(a).height(r).staggerLabels(!0).tooltips(!1).showValues(!1);return d3.select("#"+t).datum([JSON.parse(e)]).attr("height",r).call(l),d3.select("#"+t).append("text").attr("x",200).attr("y",12).attr("text-anchor","middle").style("font-weight","bold").text(n),nv.utils.windowResize(l.update),l})}